import React, { Fragment } from "react";
import Moment from "react-moment";

const SearchResults = props => {
  const {
    hits: stories,
    nbHits,
    query,
    processingTimeMS,
    nbPages,
    params,
    page
  } = props.stories;

  console.log(props.queries);

  return (
    <Fragment>
      <ResultsHeader />
      <ol className="stories">
        {stories.map(story => (
          <li key={story.objectID}>
            <a href={story.url}>{story.title}</a>
            <small>
              {story.points} points by {story.author}{" "}
              <Moment fromNow>{story.created_at}</Moment> | {story.num_comments}{" "}
              comments
            </small>
          </li>
        ))}
      </ol>

      {page > 0 && (
        <p>
          Page {page} of {nbPages}
        </p>
      )}

      {props.queries.length > 0 && (
        <div>
          <hr />
          <h2>Redux Search History</h2>
          {props.queries.map(query => (
            <p>{query}</p>
          ))}
        </div>
      )}
    </Fragment>
  );
};

const ResultsHeader = ({ nbHits, query, processingTimeMS, params }) => {
  query.length > 0 ? (
    <p>
      {nbHits} results for <strong>{query}</strong> ({processingTimeMS}ms):
    </p>
  ) : params.slice(-10) === "front_page" ? (
    <p>
      <strong>Top Stories</strong>
    </p>
  ) : (
    <p>
      <strong>Latest Stories</strong>
    </p>
  );
};

export default SearchResults;
